import React from "react";
import Header from "./components/Header";
import Container, { Row } from "reactstrap";
import SideNav from "./components/SideNav";

const App = () => {
	return (
		<div className="App">
			<Header />
			<Container>
				<Row>
					<Col xs={12} sm={4}>
						<SideNav />
					</Col>
				</Row>
			</Container>
		</div>
	);
};

export default App;
